import { jsPDF } from "jspdf"
export const font1 = '';
export const callAddFont = function () {
this.addFileToVFS('ofont.ru_Roboto-normal.ttf', font1);
this.addFont('ofont.ru_Roboto-normal.ttf', 'ofont.ru_Roboto', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])


const font = '';
export const callAddFont2 = function () {
    this.addFileToVFS('Roboto-Bold-normal.ttf', font);
    this.addFont('Roboto-Bold-normal.ttf', 'Roboto-Bold', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont2])
